import React, {useState} from 'react'

function Counter() {
    const [count, setCount] = useState(0);
    return(
        <div>
            <span>Counter Count: {count}</span><br/>
            <button onClick={()=>setCount(count+1)}>Up the game !!</button>
        </div> 
    )
}

export default Counter
